import React from "react";

function Road(props) {
        return (
            <div
            className = {props.StylingInfo}
            style = {{
            height: props.height, 
            width: props.width,
            right: props.right,
            left: props.left,
            top:props.top
            } 
            }>
                <p style = {{backgroundColor: 'green', alignContent:'center'}}> -</p>
            </div>
        )
}

export default Road;
